import React, { useEffect, useState } from "react";
import axios from "axios";

export const AnalysisTab = () => {
  const [data, setData] = useState({
    highestSaleYear: 0,
    highestSaleCount: 0,
    highestEvCity: "",
    highestEvCount: 0,
    highestExpenseYear: 0,
    highestExpenseAmount: 0,
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          "http://localhost:5000/api/ev-analysis"
        );
        setData(response.data);
      } catch (error) {
        console.error("Error fetching data", error);
      }
    };
    fetchData();
  }, []);

  return (
    <div className="row">
      {/* Highest Sales Year */}
      <div className="col-md-6 col-xl-3">
        <div className="card">
          <div className="card-body">
            <div className="mb-4">
              <span className="badge badge-soft-primary float-end">
                All Time
              </span>
              <h5 className="card-title mb-0">Highest Sales Year</h5>
            </div>
            <div className="row d-flex align-items-center mb-4">
              <div className="col-8">
                <h2 className="d-flex align-items-center mb-0">
                  {data.highestSaleYear}
                </h2>
              </div>
              <div className="col-4 text-end">
                <span className="text-muted">{data.highestSaleCount}</span>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* City with Highest EV Count */}
      <div className="col-md-6 col-xl-3">
        <div className="card">
          <div className="card-body">
            <div className="mb-4">
              <span className="badge badge-soft-primary float-end">
                All Time
              </span>
              <h5 className="card-title mb-0">City with Highest EV Count</h5>
            </div>
            <div className="row d-flex align-items-center mb-4">
              <div className="col-8">
                <h2 className="d-flex align-items-center mb-0">
                  {data.highestEvCity}
                </h2>
              </div>
              <div className="col-4 text-end">
                <span className="text-muted">{data.highestEvCount}</span>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Highest Expense Year */}
      <div className="col-md-6 col-xl-3">
        <div className="card">
          <div className="card-body">
            <div className="mb-4">
              <span className="badge badge-soft-primary float-end">
                All Time
              </span>
              <h5 className="card-title mb-0">Highest Expense Year</h5>
            </div>
            <div className="row d-flex align-items-center mb-4">
              <div className="col-8">
                <h2 className="d-flex align-items-center mb-0">
                  {data.highestExpenseYear}
                </h2>
              </div>
              <div className="col-4 text-end">
                <span className="text-muted">${data.highestExpenseAmount}</span>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
